// Register.js

import React, { useState } from "react";
import { registerUser } from "./ApiCalls"; // Adjust the import path based on your project structure

const Register = () => {
  // State variables for registration form fields
  const [fname, setFname] = useState("");
  const [lname, setLname] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [accountType, setAccountType] = useState(""); // Define available account types
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      // User data structured according to your API's expectations
      const userData = {
        fname,
        lname,
        username,
        email,
        password,
        phone_number: phoneNumber,
        account_type: accountType,
      };

      // Call the API to register the user
      const response = await registerUser(userData); // Call your API function

      // Set success message and clear inputs
      setSuccess("Registration successful! You can now log in.");
      // Optionally reset form fields here
      setFname("");
      setLname("");
      setUsername("");
      setEmail("");
      setPassword("");
      setPhoneNumber("");
      setAccountType("");
      setError(""); // Clear any previous errors
    } catch (err) {
      setError(err.message);
      setSuccess(""); // Clear success message
    }
  };

  return (
    <div>
      <h2>Register</h2>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {success && <p style={{ color: "green" }}>{success}</p>}
      <form onSubmit={handleRegister}>
        <div>
          <label>First Name:</label>
          <input
            type="text"
            value={fname}
            onChange={(e) => setFname(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Last Name:</label>
          <input
            type="text"
            value={lname}
            onChange={(e) => setLname(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Phone Number:</label>
          <input
            type="text"
            value={phoneNumber}
            onChange={(e) => setPhoneNumber(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Account Type:</label>
          <select
            value={accountType}
            onChange={(e) => setAccountType(e.target.value)}
            required
          >
            <option value="">Select Account Type</option>
            <option value="basic">personal</option>
            <option value="premium">business</option>
            {/* Add more account types as needed */}
          </select>
        </div>
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default Register;
